import React from 'react';
import CardStore from '../../components/Card'

const StoresSelect = () => {
    return (
        <>
            <main style={{ display: 'flex', width: '100%', height: '100%', alignItems:'center', justifyContent:'center', background: 'linear-gradient(90deg, rgba(255,119,59,1) 0%, rgba(255,142,36,1) 35%, rgba(255,84,67,1) 100%)' }}>
                <CardStore title='Canapolis'></CardStore>
                <CardStore title='Centralina'></CardStore>
                <CardStore></CardStore>
            </main>
        </>
    )
}

export default StoresSelect;
